import './App.css';
import { useState } from "react";
import Axios from 'axios';

function App() {
  const [name, setName] = useState("");
  const [age, setAge] = useState(0);
  const [country, setCountry] = useState("");
  const [position, setPosition] = useState("");
  const [wage, setWage] = useState(0);
  const [employeeList, setemployeeList] = useState([])

  const addEmployee = () =>{
    const URL = "http://localhost:3001/new"
    const body = {
      name: name, 
      age: age, 
      country: country,
      position: position,
      wage: wage
    }
    Axios.post(URL, body)
    .then(response => {console.log(response)})
    .catch(error => {console.log(error)})
  };

  const getEmployees = () =>{
    const URL = "http://localhost:3001/get"
    Axios.get(URL)
    .then(response => {setemployeeList(response.data)})
    .catch(error => {console.log(error)})
  }

  return (
    <div className="App">
      <div className="form">
        <label>Param1: </label>
        <input type="text" onChange={(event => setName(event.target.value))}/>
        <label >Param2(num): </label>
        <input type="number" onChange={(event => setAge(event.target.value))}/>
        <label >Param3: </label>
        <input type="text" onChange={(event => setCountry(event.target.value))}/>
        <label >Param4: </label>
        <input type="text" onChange={(event => setPosition(event.target.value))}/>
        <label >Param5(double): </label>
        <input type="number" onChange={(event => setWage(event.target.value))}/>
        <button onClick={addEmployee}>Add to database</button>
        <button onClick={getEmployees}>Show Data</button>
      </div>
        {
          employeeList.map((val,key)=>{
            return <div key={val.id}>
              <table>
                <thead>
                  <tr>
                    <th>Name</th>
                    <th>Age</th>
                    <th>Country</th>
                    <th>Position</th>
                    <th>Wage</th>
                  </tr>
                </thead>

                <tbody>
                  <tr>
                    <td><h3>{val.name}</h3></td>
                    <td><h3>{val.age}</h3></td>
                    <td><h3>{val.country}</h3></td>
                    <td><h3>{val.position}</h3></td>
                    <td><h3>{val.wage}</h3></td>
                  </tr>
                </tbody>

              </table>

            </div>
          })
        }

    </div>
  );
}

export default App;
